import React from 'react';
import './info.css';
import SearchBar from '@material-ui-search-bar'

function info() {
  return (
    <div className="info">
      <SearchBar
      onChange={() => console.log('onChange')}
      onRequestSearch={() => console.log('onRequestSearch')}
      style={{
        margin: '0 auto',
        maxWidth: 800
      }}
    />
    </div>
  );
}

export default info;
